    .start
    {
        text-align: center;
        margin: 2% 0;
    }

    .mid
    {
        background-color: rgb(0, 30, 148);
        border-width: 10px;
        border-color: red;
        border-style: solid;
        border-radius: 50px;
        display: inline-block;
        padding: 14px;
        color: antiquewhite;
        text-align: center;
    }

    .mid h1{
        
        margin: 7;
        font-size: 280%;
    }

    .right
    {
        text-align: center;
        margin-top: 70px;
    }

    .right button{
        border: 2px solid rgb(255, 255, 255);
        background-color: rgb(0, 100, 176);
        font-family: 'Josefin Sans', sans-serif;
        font-size: 130%;
        padding: 4px;
        border-radius: 10px;
        
    }

    .btn a{
        text-decoration: none;
        color: rgb(255, 255, 255);
    }

    .bt{
        border: none;
        border-radius: 10px;
        background-color: rgb(0, 119, 255);
    }

    .bt:hover
    {
        background-color: rgb(62, 62, 255);
        cursor: pointer;
    }

    .bt:active{
